"use strict";(function(){function ready(fn){if(document.readyState!="loading"){fn()}else{document.addEventListener("DOMContentLoaded",fn)}}function pixelateImages(images){if(images){images.forEach(function(image){if(image.complete){image.src=image.src+"?"+(new Date).getTime()}image.addEventListener("load",function(e){this.pixelate()})})}}ready(function(){pixelateImages(document.querySelectorAll("img"));document.addEventListener("DOMNodeInserted",function(e){if(e.target&&e.target.querySelectorAll){pixelateImages(e.target.querySelectorAll("img"))}})})})();